#include <stdio.h>

int main() {
    int n, i;
    int t1 = 0, t2 = 1;
    int nextTerm;

    printf("Enter the number of terms: ");
    scanf("%d", &n);

    printf("Fibonacci Series: ");

    for (i = 1; i <= n; ++i) {
        printf("%d, ", t1);
        nextTerm = t1 + t2;
        t1 = t2;
        t2 = nextTerm;
    }
    printf("\n");
    return 0;
}
```

This C code generates the Fibonacci series up to a specified number of terms.

**How it works:**

1.  It initializes `t1` to 0 and `t2` to 1, which are the first two terms of the Fibonacci series.
2.  It prompts the user to enter the number of terms they want to see.
3.  It then loops `n` times:
    *   In each iteration, it prints the current `t1`.
    *   It calculates the `nextTerm` by adding `t1` and `t2`.
    *   It updates `t1` to the value of `t2`.
    *   It updates `t2` to the value of `nextTerm`.

This process effectively shifts the values to generate the next number in the sequence.
